						Sed non risus. Suspendisse lectus tortor, dignissim sit amet, adipiscing nec, ultricies sed, dolor.</p>
						<div className="btn">
							<button className="btn-by">By now</button>
							<div className="btn-content">
								<Link exact to={`${this.props.match.url}/products/${1}`}><IconButton><Info htmlColor="skyblue"/></IconButton></Link>
